import React, { Component } from 'react';
import PropTypes from 'prop-types';

class InputName extends Component {

  render() {
    const { name, handleChange, type, value } = this.props;
    return (
      <input
        name={ name }
        onChange={ handleChange }
        type={ type }
        value={ value }
      />
    );
  }
}



export default InputName;
